import React from "react";
import { useState } from "react";
import Typewriter from "typewriter-effect";
import "./home.css";
import { motion } from "framer-motion";

const Home = () => {
  const [heading, setheading] = useState(true);
  setInterval(() => {
    setheading(false);
  }, 4000);
  return (
    <>
      <motion.div
        className="container1"
        initial={{ color: "white", opacity: 0 }}
        animate={{ color: "#8c4646", scale: "1.3", y: -110, opacity: 1 }}
        transition={{ delay: 2, duration: 1.5, type: "spring", stiffness: 80 }}
      >
        AnimatePrese
        <motion.h2>Hello Everyone I am Anish Kumar Singh</motion.h2>
        <div className="typer">
          <Typewriter
            onInit={(typewriter) => {
              typewriter
                .pauseFor(2000)
                .typeString("Learner")
                .pauseFor(2500)
                .deleteAll()
                .typeString("Programmer")
                .pauseFor(2500)
                .deleteAll()
                .typeString("Developer")
                .pauseFor(2500)
                .deleteAll()
                .typeString("Data Structures Enthusiast")
                .pauseFor(2500)
                .deleteAll()
                .typeString("Developer")
                .pauseFor(2500)
                .deleteAll()
                .start();
            }}
          />
        </div>
      </motion.div>
    </>
  );
};

export default Home;
